import CreateToDo from "./CreateToDo";
import { toDoSelector, toDoState } from "../atoms";
import ToDo from "./ToDo";

function ToDoList() {
  const [toDo, doing, done] = useRecoilValue(toDoSelector);

  return (
    <div>
      <h1>To Do</h1>
      <hr />
      <CreateToDo />
      <select>
        <option>To Do</option>
        <option>Doing</option>
        <option>Done</option>
      </select>
    </div>
  );
}

export default ToDoList;
